import React from 'react';
import Forms from './Forms';
import './assets/scss/home.scss';

class Home extends React.Component {
    render() {
        return (
            <div>
                <h1 className="header"> SELL IT TO ME </h1>
                <div className="main-row">
                    <div className="main-column" id="left-column">
                        <h2 className="home-header"> Get a quick cash offer for your vehicle today from Mr. Cash! </h2>
                        <h2 className="header2"> How it works </h2>
                        <ol>
                        <li className="home-list"> Enter information about your car </li>
                        <li className="home-list"> Get a estimated offer </li>
                        <li className="home-list"> GET AN OFFICIAL OFFER WITHIN 24 HOURS </li>
                        <li className="home-list"> CHOOSE PICK-UP OR DELIVERY </li>
                        <li className="home-list"> GET CASH </li>
                        </ol>
                    </div>
                    <div className="main-column" id="right-column">
                        <Forms />
                    </div>
                </div>
            </div>
        )
    }
}

export default Home;
